                {
                    title: "Home",
                    url: "/",
                    cName: "nav-links"
                },
                {
                    title: "Content",
                    url: "/content",
                    cName: "nav-links"
                },
                {
                    title: "MyPosts",
                    url: "/myposts",
                    cName: "nav-links"
                },
                {
                    title: "NewPost",
                    url: "newpost",
                    cName: "nav-links"
                }
            ]
            }
        }

    logout = () => {
        localStorage.clear();
        console.log("logged out")
    }

    componentDidMount() {
        if(localStorage.getItem("token"))
        {
            this.setState({ loggedIn: true})
        }
    }

