                                    {item.title}
                                </a>
                            </div>
                        )
                    })} */}

                    {(() => {
                    switch (this.state.loggedIn) {
                        case true:
                            return(
                                <div> logged in
                                </div>
                            )
                        default:
                            return (
                                <div> no login
                                </div>
                            )
                    }
                    })()}

                    <div key="logout" className="col-sm">
                        <a className="" href="/" onClick={() => {this.logout()}}>
                            Logout
